List<String> getRecommended(List<String> input, List<String> visited) {
  var r = visited[rnd.nextInt(visited.length)];
  Set<dynamic> visitedSet = visited.toSet();
  Set<dynamic> inputSet = input.toSet();
  List<dynamic> left = inputSet.difference(visitedSet).toList();
  left.sort((e1, e2) => map[r][e1].compareTo(map[r][e2]));
  return [input[0], input[1], input[2]];
}
